'use strict';
let MessageType = require('./MessageType.js');
let OpenPositionsList = require('./OpenPositionsList.js');
class GetOpenPositionsMessage {
    openPositionsList;
    accountId;
    constructor() {
        this.openPositionsList = new OpenPositionsList();
    }
    getOpenPositions() {
        return this.openPositionsList.toArray();
    }
    getType() {
        return MessageType.GetOpenPositions;
    }
    getAccountId() {
        return this.accountId;
    }
}
module.exports = GetOpenPositionsMessage
